import React, {useContext, useState, useEffect} from 'react'
import {Spin} from 'antd'
import Head from 'next/head'
import SellingPage from '../src/areas/SellingPage'
import { UserContext } from '../src/lib/UserContext';
import {seeIfLogin} from '../src/lib'
import OpenPage from '../src/areas/OpenPage'
import styled from 'styled-components'

const SpinContainer = styled.div`
    width: 100%;
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
`

const Selling: React.FC = () => {
    const { api, setToken } = useContext(UserContext)
    const [isLoading, setIsLoading] = useState(true)

    useEffect(() => {
        seeIfLogin(api, setToken, OpenPage).then(() => {
            setIsLoading(false)
        })
    }, [])

    return (
        <>
            <Head>
                <title>MasterSeats â€¢ Selling</title>
            </Head>
            {isLoading ? <SpinContainer><Spin/></SpinContainer> : <SellingPage />}
        </>
    );
};

export default Selling;
